// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Parent{// Ethereum
    uint private a;
    uint private b;
    uint private sum;

    event added(uint indexed added);// emitting an event

    // Function to add
    function add(uint _a,uint _b)
    external{
        a = _a;
        b = _b;
        sum = a + b;
        emit added(sum);
    }

    // Function to get values
    function get()
    view // Im looking at state variables
    external
    returns(uint){
        return sum;       
    }
}

contract child is Parent{// Polygon

    uint public multiply;

    // Multiply function
    function multi(uint _a,uint _b)
    public{
        multiply = _a * _b;
    }


}

